Enterprise Income Tax Law of the People's Republic of China  
Chapter IV Tax Incentives  
Article 57 The following income of an enterprise may be exempted or reduced from enterprise income tax:  
(1) Income derived from engaging in agriculture, forestry, animal husbandry, and fishery projects;  
(2) Income derived from investing in and operating public infrastructure projects supported by the state;  
(3) Income derived from engaging in environmental protection or energy and water conservation projects that meet the prescribed conditions;  
(4) Income from technology transfer that meets the prescribed conditions;  
(5) Income specified in Paragraph 3 of Article 3 of this Law.
